INSERT INTO `mv` VALUES (1,'https://taffy104.s3.ap-northeast-2.amazonaws.com/common/en_00_01.mp3','','https://lab.ssafy.com/s11-webmobile1-sub2/S11P12E104/uploads/0dcccf2622cc12e196c4c055deb116d6/rn_image_picker_lib_temp_aef319cf-e92b-407f-9a8f-bded85b04fe9.gif','Stand in gathering pose with your left foot one foot wide.\r\nOpen your hands and inhale, raising them from the front of the danjen to the front of the mingchi.\r\nKeep your face, torso, and lower body aligned with your centerline to maintain balance.\r\nThe distance between the two fists should be one fist apart.\r\nAt the end of the warm-up, leave 30 percent of your breath in the taiji.\r\nBe careful not to lift your shoulders','Are you ready?','왼발을 한 발 길이로 벌리고 모아서기 자세로 섭니다. 두 손을 펴고 숨을 들이마시며 단전 앞에서 명치 앞까지 올립니다. 얼굴, 몸통, 하체를 중심선에 정렬하여 균형을 유지합니다. 두 주먹 사이의 거리는 주먹 하나 정도의 간격을 유지합니다. 준비 운동이 끝날 때, 호흡의 30%를 태극에 남겨두세요. 어깨가 들리지 않도록 주의하세요.','기본 준비자세','','STD'),(2,'https://taffy104.s3.ap-northeast-2.amazonaws.com/chap1/voice/en_01_02.mp3','https://taffy104.s3.ap-northeast-2.amazonaws.com/chap1/voice/ko_01_01.m4a','https://taffy104.s3.ap-northeast-2.amazonaws.com/chap1/mv2.gif','Turn left 90 degrees into a walking stance with foot forward, left low block','Left walking stance, left wrist low block','왼쪽으로 90도 회전하여 앞서기로 서서 왼손 아래막기를 합니다.','왼 앞서기, 왼팔목 아래막기','https://seojihyeon.s3.ap-northeast-2.amazonaws.com/taffy/1_1.png','STD'),(3,'https://taffy104.s3.ap-northeast-2.amazonaws.com/chap1/voice/en_01_03.mp3','https://taffy104.s3.ap-northeast-2.amazonaws.com/chap1/voice/ko_01_02.m4a','https://taffy104.s3.ap-northeast-2.amazonaws.com/chap1/mv3.gif','Step forward into walking stance with right foot forward, right hand middle punch','Right waliking stance, right fist middle reverse punch','오른발을 앞으로 내딛어 앞서기 자세로 서서 오른손으로 몸통 지르기를 합니다.','오른 앞서기, 오른 주먹 몸통 반대지르기','https://seojihyeon.s3.ap-northeast-2.amazonaws.com/taffy/1_2.png','STD'),(4,'https://taffy104.s3.ap-northeast-2.amazonaws.com/chap1/voice/en_01_04.mp3','https://taffy104.s3