INSERT INTO `ps` VALUES (1,2,'https://seojihyeon.s3.ap-northeast-2.amazonaws.com/1.png','https://www.youtube.com/watch?v=lKgP1DnC-Zk','Taegeuk 1 Jang corresponds with Keon (sky) or heaven, that is, the first trigram of Palgwe which represents heaven and light. Keon refers to Yangin the relative action of Yin and Yang in Taegeuk. It represents the energy that marks the beginning of all things. In addition, since Keon corresponds with the head in the human body, it implies the correct understanding of Taekwondo’s basic movements and the acquisition of skills through the first Poomsae practice.','Taegeuk 1 : Sky','태극 1장은 팔괘 중에서 하늘을 상징하는 건(建)에 해당한다. 건이란 태극에 있어 음과 양의 상대 작용에서 양(陽)을 가리키며, 만물의 시작을 알리는 기운을 나타낸다.\r\n\r\n또한, 건은 인체에 있어서 머리에 해당하므로 첫 번째 품새 수련을 통해서 태권도의 기본이 되는 동작의 바른 이해와 기술 습득을 의미한다.','태극 1장 : 하늘'),(2,3,'https://seojihyeon.s3.ap-northeast-2.amazonaws.com/2.png','https://www.youtube.com/watch?v=KLEeB1H5PeM','Taegeuk 2 Jang symbolizes “Tae” in Taegeuk. “Tae” literally means a pond with a calm surface. Applied to the human body, it means controlling breath and further, emotions. While the Poomsae practice, you need to concentrate your aura on the lower abdomen which must not disperse outside the body due to the moves. Irrespective of acquiring technique, using them for precise attack and defense is difficult without controlling breathing and emotions. Thus, the practitioner should train\r\n\r\nPoomsae like a pond with a calm surface but with depth, and achieve a state of “an iron fist in the velvet glove.”','Taegeuk 2 : Pond','태극 2장은 태극의 태(兌)를 상징한다. 태란 본래 수면이 고요한 연못을 상징하는 말이다.\r\n\r\n그러므로 이를 인체의 작용에 응용한다면 호흡을 조절하는 것이며 더 나아가서는 감정을 다스리는 과정을 뜻한다.\r\n\r\n이러한 이유로 품새를 수련할 때 동작을 따라서 몸의 기운이 밖으로 분산되지 않도록 아랫배를 중심으로 기운을 가라앉혀야 한다.\r\n\r\n이는 기술을 습득했다 하더라도 호흡과 감정을 올바르게 통제할 수 없다면 정확한 공격과 방어가 어렵기 때문이다.\r\n\r\n따라서 태의 의미는 수면은 고요하나 수심이 깊은 연못과 같은 마음가짐으로 품새를 수련하고 전체적으로 외유내강을 이루어야 한다.','태극 2장 : 연못'),(3,4,'https://seojihyeon.s3.ap-northeast-2.amazonaws.com/3.png','https://www.youtube.com/watch?v=ZUKAsSi-ziA','Taegeuk 3 Jang represents “Ri” in Palgwe. Ri symbolizes fire and clarity, like the sun. It corresponds with the heart in the human body, which further refers to the process of developing a courageous mindset. If you look at the nature of fire, it starts with a small spark and spreads rapidly, burning everything in an instant. Such uncontrolled force and light that spreads everywhere does not help in Poomsae practice. Taeguek 3 Jang is a practice method comprising the accurate learning of forces and techniques that correspond with fire and light, and practicing the bold moves by connecting defense and attack.','Taegeuk 3 : Sun','태극 3장은 팔괘의 이(離)를 의미한다.\r\n\r\n이는 태양과 같은 밝고 뜨거운 기운을 상징한다. 그러므로 인체에서는 심장에 해당하며, 용맹한 마음을 양성하는 과정을 뜻한다.\r\n\r\n불의 성질을 살펴보면 일단 작은 불씨를 시작으로 급속도로 번지게 돼 모든 것을 순식간에 태워버린다.\r\n\r\n이처럼 통제되지 않은 불의 힘과 사방으로 흩어져버리는 빛은 품새 수련에 도움이 될 수 없으며 불과 빛에 해당하는 힘과 기술을 정확하게 몸에 익히고, 품새 동작 시에 과감하게 방어와 공격을 연결하며 수련한다는 의미를 지닌다.','태극 3장 : 태양'),(4,5,'https://seojihyeon.s3.ap-northeast-2.amazonaws.com/4.png','https://www.youtube.com/watch?v=FbqjsUndH2M','Taegeuk 4 Jang represents “Jin” in Palgwe. “Jin” symbolizes arousing instant thunder and lightning. In the Orient, Jin is referred to as the dragon of heaven. In the human body, it represents mobility of both the feet that facilitates speedy movement and powerful kicks. Using the feet, you can twist your body to quickly change direction or attack. This is a process of attacking the opponent by taking advantage of the distance from the opponent, like an ever-changing dragon.','Taegeuk 4 : Thunder','태극 4장은 팔괘의 진(震)에 해당한다.\r\n\r\n진은 구름 속에서 순식간에 일어나는 천둥과 번개를 나타낸다. 이를 비유해서 동양에서는 진을 하늘의 용(龍)이라고 하였다.\r\n\r\n인체에 있어서 진은 쾌속한 움직임과 강력한 차기를 가능하게 하는 두 발의 기동력을 의미한다.\r\n\r\n따라서 두 발을 사용해 온몸을 틀어 신속하게 방향을 바꾸거나 공격 한다.\r\n\r\n이는 상대와의 거리를 나에게 유리하게 만들면서 변화무쌍한 용처럼 공격해가는 과정을 의미한다.','태극 4장 : 천둥'),(5,6,'https://seojihyeon.s3.ap-northeast-2.amazonaws.com/5.png','https://www.youtube.com/watch?v=1c5tRnshbwA','Taegeuk 5 Jang represents “Son”, in Palgwe. “Son” symbolizes wind, which is gentle but can abruptly transform into a typhoon. In the human body, it corresponds with the pelvis and hip joint. Meaning, the muscles around the pelvis and hip joint must be relaxed to assume a stable and powerful posture while practicing Poomsae. This part of the body is the base that supports the spine and helps in taking stable and flexible postures. It is also the source of the rotational force and powerful kicks. Taegeuk 5 Jang involves the practice of techniques with different postures to exert power diversely, like an unpredictable typhoon','Taegeuk 5 : Wind','태극 5장은 팔괘의 손(巽)에 해당한다.\r\n\r\n손은 바람을 가리키며 평소에는 고요하지만, 때에 따라 큰 태풍으로 돌변하기도 한다.\r\n\r\n인체에서는 골반과 엉덩관절 부위를 가리키며 품새를 수련하면서 안정되고 강력한 자세를 취하기 위해서는 골반과 엉덩관절 주변의 근육이 이완돼 있어야 함을 의미한다.\r\n\r\n특히, 이 부위는 척추를 받치고 있는 기반이 되는 곳으로서, 모든 자세를 탄력 있게 지탱할 수 있도록 도와준다.\r\n\r\n또한, 몸의 회전력과 차기의 근원적인 힘이 발산되는 부위이기도 하다.\r\n\r\n따라서 회오리 바람이 뭉쳐진 태풍과 같이 예측하지 못하는 방향으로 여러 가지 자세를 통한 기술 수련을 함으로써 몸의 힘을 다양하게 발휘하도록 수련하는 과정을 뜻한다.','태극 5장 : 바람'),(6,7,'https://seojihyeon.s3.ap-northeast-2.amazonaws.com/6.png','https://www.youtube.com/watch?v=YkW4UY5HsKI','Taegeuk 6 Jang represents “Gam” in Palgwe. “Gam” symbolizes flowing water. In the human body, it represents the ear, including the ability to hear sound and feel the sturdiness and gentleness of the power around oneself as their own. In this process, you should understand how to counterattack by brushing o2.ff the opponent’s\r\n\r\nstrength as water flows over obstacles. Like the water flows without interruption, irrespective of the path’s width and obstacles, Poomsae techniques should flow seamlessly. However, sometimes water suddenly falls and forms a waterfall. Thus, this practice process includes the overall release of power and practice, as well as the connection of apparent techniques','Taegeuk 6 : Water','태극 6장은 팔괘의 감(坎)에 해당한다.\r\n\r\n감은 끊임없이 흐르는 물을 상징하고 있다. 인체에서는 귀를 의미하며 단지 소리만을 듣는 것이 아니라 나와 주변의 힘의 강약을 느끼는 감각 능력을 포함해야 한다.\r\n\r\n따라서 이 과정에서는 흐르는 물이 장애물을 타고 넘어가듯이, 상대의 힘을 빗겨 흘리며 반격하는 느낌으로 품새를 수련해야 한다.\r\n\r\n물이 흘러가는 길의 폭이 좁거나 넓거나 때로는 장애물이 있더라도 그 름에 끊어짐이 없듯이, 품새의 기술은 물이 흐르듯이 연결되어야 한다.\r\n\r\n그러나 물이 폭포와 같이 갑자기 아래로 떨어지며 흐를 때도 있는 것처럼 단지 외형적인 기술의 연결만을 의미하는 것이 아니라, 전체적인 힘의 발산과 수련의 과정을 의미한다.','태극 6장 : 물'),(7,8,'https://seojihyeon.s3.ap-northeast-2.amazonaws.com/7.png','https://www.youtube.com/watch?v=7OrejwNss6o','Taegeuk 7 Jang represents “Gan” in Palgwe. “Gan” symbolizes a strong mountain range with meandering ridges and the connection between mountains. It represents the spine, the flexion and extension of joints and vertebrae in the human body. A mountain is more than a pile of soil; it includes the flow of groundwater through its rocks. Mountain soil, rocks, and groundwater correspond with muscles, joints, and blood vessels and nerves in the human body, respectively. At this stage, you should train to exert force along with the efficient use of flexion and extension of joints and muscles.','Taegeuk 7 : Mountain','태극 7장은 팔괘의 간(艮)에 해당한다.\r\n\r\n간은 산등성이가 굽이쳐 흐르는 산맥을 나타내며 산과 산이 연결된 모습을 말한다.\r\n\r\n인체에서는 척추를 말하며, 전체적으로는 몸 안의 관절과 척추뼈의 굴신 운동을 가리킨다.\r\n\r\n산이랑 단지 흙이 높이 쌓여 있는 것 뿐만 아니라 그 안의 바위 사이로 지하수가 흐르는 것을 포함하는 것처럼, 산의 흙, 바위, 지하수는 인체에서 근육, 관절, 혈관 및 신경에 해당한다.\r\n\r\n따라서 이 과정에서는 온몸의 관절과 근육이 효율적으로 굴신 운동을 하면서 강한 힘을 발휘하도록 수련해야 한다.','태극 7장 : 산맥'),(8,9,'https://seojihyeon.s3.ap-northeast-2.amazonaws.com/8.png','https://www.youtube.com/watch?v=1u8PtE8Swdo','Taegeuk 8 Jang represents “Gon” in Palgwe. “Gon”symbolizes the earth ― the ground where all creatures take root and live ― with the spirit of Yin. Gon represents the abdomen that protects the internal organs in the human body. While Keon in Taegeuk 1 Jang signifies the beginning of all things, Gon symbolizes the living ground of all things ― where they grow and bear fruit. Similarly, all the human power comes from the abdomen. At this stage, you will strengthen the abdomen and train to attack using the whole body with both feet in the air. Through the organic connection of the upper and lower body, the entire seven stages are completed.','Taegeuk 8 : Ground','태극 8장은 팔괘의 곤(坤)에 해당한다.\r\n\r\n곤은 음의 기운인 땅을 나타내며 세상의 만물이 뿌리를 내리고 살아가는 터전을 말한다.\r\n\r\n인체에서 곤은 오장육부를 보호하는 복부를 가리킨다.\r\n\r\n인체의 모든 힘이 배에서 나오게 되는 것처럼 태극 1장에서의 건이 만물의 시작이 되는 기운을 뜻한다면 곤은 만물이 성장하고 결실을 거두는 만물의 생활 터전의 의미가 있다.\r\n\r\n따라서 이 과정은 복부의 힘을 강화하고, 두 발이 공중에 뜬 상태로 전신을 던져 공격하는 수련을 하게 된다.\r\n\r\n또한, 상체와 하체의 유기적인 연결 동작을 통해서 전체적인 일곱과정을 모두 마무리하게 된다.','태극 8장 : 땅');
